message:
Олимпиада в Пекине всё. Питерские спортсмены возвращаются домой — с медалями и миллионами в карманах спортивных костюмов. Циферки за нервы, пот и слёзы олимпийцев получились такие: 

— Анастасия Мишина получит 6,5 миллионов за золото + бронзу в фигурном катании;
— Её партнёр Александр Галлямов столько же — за те же награды;
— За четвёртые места по 600 тысяч фигуристам Александре Бойковой и Дмитрию Козловскому;
— Биатлонист Максим Цветков забирает 1,5 ляма за бронзу и дважды по 600К за два четвертых места;
— Хоккеисты: Никита Гусев, Александр Самонов и Кирилл Марченко увозят каждый по 2,5 мульта за серебро.

Всего Петербург отправлял на Игры 29 спортсменов в девяти видах спорта. Крупные суммы полагались за места с первого по шестое, а остальные получат символические 50 тысяч и бесценный опыт.
